import "./Queue.css";

export default function QueueItem(url) {
	// const track = "Trackname";
	// const artist = "Artist";
	// const duration = "5:00";
	const value = (Math.random() * 100).floor().toString();

	return (
		<div className="Queue-Item" draggable="true">
			<p>{value}</p>
		</div>
	);
}
